class Submission:
    def __init__(self, submission_id, status, data_file):
        self.submission_id = submission_id
        self.status = status
        self.data_file = data_file

class SubmissionManager:
    def __init__(self):
        self.submissions = {}
        self.logs = []

    def submit_data(self, submission_id, status, data_file):
        submission = Submission(submission_id, status, data_file)
        self.submissions[submission_id] = submission
        self.log(f"Submitted data for ID {submission_id} with status {status}")

    def view_submission_history(self):
        return [(sub.submission_id, sub.status) for sub in self.submissions.values()]

    def validate_submission(self, submission_id):
        submission = self.submissions.get(submission_id)
        if submission and submission.status == 'pending':
            submission.status = 'validated'
            self.log(f"Submission {submission_id} validated.")
            return True
        self.log(f"Validation failed for {submission_id}. Status: {submission.status if submission else 'not found'}")
        return False

    def download_file(self, submission_id):
        submission = self.submissions.get(submission_id)
        if submission:
            self.log(f"File for submission {submission_id} downloaded.")
            return submission.data_file
        self.log(f"Download failed for {submission_id}. Submission not found.")
        return None

    def log(self, message):
        self.logs.append(message)

    def get_logs(self):
        return self.logs

class UserTestingManager:
    def __init__(self):
        self.testing_sessions = []

    def schedule_testing_session(self, date, user_ids):
        session = {
            'date': date,
            'user_ids': user_ids
        }
        self.testing_sessions.append(session)

    def generate_summary_report(self):
        report = {
            'total_sessions': len(self.testing_sessions),
            'session_details': self.testing_sessions
        }
        return report

class Broker:
    def __init__(self, submission_manager):
        self.submission_manager = submission_manager

    def upload_and_validate_submission(self, submission_id, status, data_file):
        self.submission_manager.submit_data(submission_id, status, data_file)
        if status == 'pending':
            return self.submission_manager.validate_submission(submission_id)
        return False

    def retrieve_error_messages(self, submission_id):
        submission = self.submission_manager.submissions.get(submission_id)
        if submission and submission.status != 'validated':
            return f"Error: Submission {submission_id} is not validated. Current status: {submission.status}."
        return "No errors found."
